import React from "react";
import { NavLink } from "react-router-dom";

const items = [
  {
    label: "Início",
    icon: "home",
    path: "/",
  },
  {
    label: "Sobre Mim",
    icon: "user",
    path: "/sobre",
  },
  {
    label: "Blog",
    icon: "pencil alternate",
    path: "/blog",
  },
  {
    label: "Serviços",
    icon: "cogs",
    path: "/servicos",
  },
  {
    label: "Contato",
    icon: "address card outline",
    path: "/contato",
  },
];

const Header = ({ onToggleMenu }) => {
  const itemList = items.map(({ label, icon, path }) => {
    return (
      <NavLink to={`${path}`} exact={path === "/"} key={label}>
        <div
          className={`item`}
          onClick={() => {
            console.log(`Route: ${path}`);
          }}
        >
          <i className={`${icon} icon`}></i> {label}
        </div>
      </NavLink>
    );
  });

  return (
    <header>
      <div className="ui top inverted attached menu">
        <NavLink to="/" exact>
          <div className={`item isActive`}>
            <img src="/images/logo2.png" />
          </div>
        </NavLink>
        <span
          className="item right floated link"
          onClick={() => {
            onToggleMenu();
          }}
        >
          <i className="bars medium icon"></i>
        </span>
      </div>
    </header>
  );
};

export default Header;
